import React from 'react'

const drumButton = ({text, volume, audio}) => {
  const handleClick = () => {
    let test = new Audio('https://s3.amazonaws.com/freecodecamp/drums/Heater-1.mp3')
    console.log("press")
    test.play();
  }
  return (
    <div className='drumButton' onClick={handleClick}>
        {text}
    </div>
  )
}

export default drumButton
